import React from "react";

export default function SectionHome() {
  return (
    <div>
    {/* Section Home */}
      <div className="flex flex-wrap w-full">
        <div className="p-2 w-1/2">
          <img src="/images/img-phone-1.png" alt="" />
        </div>
        <div className=" w-1/2">
          <div className="p-2">
            <img src="/images/img-phone-2.png" alt="" />
          </div>
          <div className="p-2">
            <img src="/images/img-phone-2.png" alt="" />
          </div>
        </div>
      </div>
    </div>
  );
}
